import React from 'react';
import './GASMASPage.css';

const GASMASPage = () => {
  return (
    <div className="gasmas-page">
      <div className="gasmas-container">
        {/* 页面标题 */}
        <div className="gasmas-header">
          <h1 className="gasmas-title">GAS MAS Schedule</h1>
        </div>

        {/* 合同信息和图片布局 */}
        <div className="contract-info-layout">
          {/* 左侧合同信息 */}
          <div className="contract-info-left">
            <div className="contract-info-section">
              <h2 className="contract-info-title">Contract Information</h2>
              <div className="contract-info-line"></div>
            </div>

            <div className="contract-details-section">
              <p className="contract-details-text">
                GSA MAS Contract Number: 47QRAA18D003Y<br/>
                Contract Period: September 28, 2018 – September 27, 2028<br/>
                NAICS Codes: 541511, 541512, 541513, 541519
              </p>
              <div className="contract-details-line"></div>
            </div>
          </div>

          {/* 右侧图片 */}
          <div className="contract-info-right">
            <img src="/images/SBA .jpg" alt="GSA Logo" className="gasmas-image" />
          </div>
        </div>

        {/* 介绍内容 */}
        <div className="introduction-section">
          <p className="introduction-text">
            Introduction – The General Services Administration (GSA) Multiple Award Schedule (MAS) is a long-term governmentwide contract vehicle that provides federal, state, and local government buyers access to more than 11 million commercial products and services at volume discount pricing.
          </p>
        </div>
      </div>
    </div>
  );
};

export default GASMASPage;
